import React from "react";
import SHOP_DATA from "./ShopData";
import CollectionPreview from "../../components/CollectionPreview/CollectionPreview";

class Shop extends React.Component {
  state = {
    collections: SHOP_DATA,
  };

  render() {
    return (
      <div className="Shop">
        <CollectionPreview />
      </div>
    );
  }
}

export default Shop;
